import React from "react";
import Card from "../Card Details/Card";
import JsonData from "../../data.json";
import Navbar from "../Navbar/Navbar";

const Home = () => {
  const recommendedData = JsonData.slice(5);
  return (
    <>
      <Navbar />
      <Card recommendedData={recommendedData} />
    </>
  );
};

export default Home;
